import React from 'react';

const Map = () => {
    return (
        <section style={styles.mapContainer}>
            <h2 style={styles.mapTitle}>Найдите нас на карте</h2>
            <iframe
                style={styles.map}
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2242.248015721424!2d37.6173!3d55.7558!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x411ad5296ffedb0f%3A0x8e149ecb50201717!2z0YPQu9C40YbQsNGA0LjQutCw!5e0!3m2!1sru!2sru!4v1633905105820!5m2!1sru!2sru"
                width="100%"
                height="400"
                allowFullScreen=""
                loading="lazy"
            ></iframe>
        </section>
    );
};

const styles = {
    mapContainer: {
        padding: '40px 20px',
        textAlign: 'center',
    },
    mapTitle: {
        fontSize: '28px',
        fontWeight: 'bold',
        marginBottom: '20px',
    },
    map: {
        border: 'none',
        borderRadius: '10px',
    },
};

export default Map;
